// [2,7,11,15] target=9

const twoSums = (arr, target) => {
  let storage = {}

  for (let i = 0; i < arr.length; i++){
    if(storage[target - arr[i]] !== undefined){
      return [storage[target - arr[i]], i]

    } else {
      storage[target - arr[i]] = i;
    }
  }
}

export default twoSums;
